import React from 'react';
import { Container, Row, Col } from 'react-grid-system';
import cacoon from './images/cacoon.png';
import egg from './images/egg.png';
import laarva from './images/laarva.png';
import moth from './images/moth.png';
import silkworm from './images/silkworm.png';

function Cycle(props) {

  return (
    <div>
    <Row>
    <Col>
    </Col>
      <Col>
        <img src={egg} style={{height:"200px",width:"200px"}}/>
      </Col>
      <Col>
      </Col>
    </Row>
      <img src={egg} style={{height:"100px",width:"100px"}}/>
      <img src={laarva} style={{height:"100px",width:"100px"}}/>
      <img src={cacoon} style={{height:"100px",width:"100px"}}/>
      <img src={moth} style={{height:"100px",width:"100px"}}/>
      <img src={silkworm} style={{height:"100px",width:"100px"}}/>
    </div>
  );
}

export default Cycle;
